def convert_to_uppercase(string):
    uppercase_string = ""
    for char in string:
        if ord('a') <= ord(char) <= ord('z'):
            uppercase_string += chr(ord(char) - ord('a') + ord('A'))
        else:
            uppercase_string += char
    return uppercase_string

