        return a
    return find_gcf(b, a % b)

def find_gcf_of_three(prime_numbers):
    gcf = prime_numbers[0]
    for i in range(1, len(prime_numbers)):
        gcf = find_gcf(gcf, prime_numbers[i])
    return gcf

