def find_unique_values(dataset):
    frequency_dict = {}
    for pair in dataset:
        value = pair[0]
        if value in frequency_dict:
            frequency_dict[value] += 1
        else:
            frequency_dict[value] = 1

    sorted_values = sorted(frequency_dict.keys(), key=lambda x: (-frequency_dict[x], x))

    return sorted_values

