def binary_search(list, number):
    start = 0
    end = len(list) - 1

    while start <= end:
        mid = (start + end) // 2
        if list[mid] == number:
            return True
        elif list[mid] < number:
            start = mid + 1
        else:
            end = mid - 1

    return False

