def get_largest_prime(limit):
    primes = []
    is_prime_number = [True] * (limit + 1)
    p = 2
    while p * p <= limit:
        if is_prime_number[p]:
            for i in range(p * p, limit + 1, p):
                is_prime_number[i] = False
        p += 1
    for p in range(2, limit + 1):
        if is_prime_number[p]:
            primes.append(p)
    return max(primes)

