def quicksort_desc(arr):
    if len(arr) <= 1:
        return arr
    else:
        pivot = arr[0]
        lesser = [x for x in arr[1:] if x >= pivot]
        greater = [x for x in arr[1:] if x < pivot]
        return quicksort_desc(greater) + [pivot] + quicksort_desc(lesser)

