import math

def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True

def sum_of_divisors(n):
    div_sum = 0
    for i in range(1, n + 1):
        if n % i == 0:
            div_sum += i
    return div_sum

def sort_prime_numbers(arr):
    n = len(arr)
    for i in range(n):
        for j in range(0, n - i - 1):
            if sum_of_divisors(arr[j]) < sum_of_divisors(arr[j + 1]):
                arr[j], arr[j + 1] = arr[j + 1], arr[j]
    return arr

# Example usage:
