def separate_odd_even(arr):
    start = 0
    end = len(arr) - 1

    while start < end:
        while arr[start] % 2 == 0 and start < end:
            start += 1
        while arr[end] % 2 == 1 and start < end:
            end -= 1

        if start < end:
            arr[start], arr[end] = arr[end], arr[start]

    return [sorted(arr[:start+1]), sorted(arr[start+1:])]

