from functools import reduce

def sum_numbers(numbers):
    def calculate_sum(acc, num):
        if num % 3 == 0 and num % 5 == 0:
            return acc - num/3
        elif num % 3 == 0 or num % 5 == 0:
            return acc + num/2
        else:
            return acc + num

    result = reduce(calculate_sum, numbers, 0)
    return round(result, 2)

