def find_primes(start, end, primes=[]):
    if start <= 1:
        return find_primes(start + 1, end, primes)
    elif start > end:
        return primes
    else:
        if is_prime(start, primes):
            primes.append(start)
        return find_primes(start + 1, end, primes)

def is_prime(num, primes):
    if len(primes) == 0:
        return True
    elif num % primes[0] == 0:
        return False
    else:
        return is_prime(num, primes[1:])

