def find_pairs(arr, target):
    count = 0
    pairs = set()
    hash_table = {}

    for num in arr:
        complement = target - num
        if complement in hash_table:
            pair = (min(num, complement), max(num, complement))
            if pair not in pairs:
                count += 1
                pairs.add(pair)
        hash_table[num] = True

    return count

