def merge_sort_descending(arr):
    stack = []
    for num in arr:
        stack.append([num])

    while len(stack) > 1:
        sub1 = stack.pop()
        sub2 = stack.pop()
        merged = merge_descending(sub1, sub2)
        stack.append(merged)

    return stack[0]


def merge_descending(arr1, arr2):
    merged = []
    i, j = 0, 0

    while i < len(arr1) and j < len(arr2):
        if arr1[i] > arr2[j]:
            merged.append(arr1[i])
            i += 1
        else:
            merged.append(arr2[j])
            j += 1

    while i < len(arr1):
        merged.append(arr1[i])
        i += 1

    while j < len(arr2):
        merged.append(arr2[j])
        j += 1

    return merged


