def parse_json(json_str):
    stack = []
    current_dict = {}
    key = ''
    value = ''
    is_string = False

    for char in json_str:
        if char == '{':
            stack.append(current_dict)
            current_dict = {}
        elif char == '}':
            if key:
                current_dict[key] = value
                key = ''
                value = ''
            if stack:
                prev_dict = stack.pop()
                prev_dict.update(current_dict)
                current_dict = prev_dict
        elif char == '"':
            is_string = not is_string
        elif char == ':':
            pass
        elif char == ',':
            if key:
                current_dict[key] = value
                key = ''
                value = ''
        elif is_string:
            value += char
        else:
            if char != ' ':
                key += char

    return current_dict

def get_price(json_str):
    try:
        parsed_json = parse_json(json_str)
        return parsed_json['price']
    except (KeyError, TypeError, IndexError):
        return None

# Example usage
json_string = '{"name": "Product", "price": 9.99, "quantity": 10}'
price = get_price(json_string)
print(price)  # Output: 9.99

