def convert_pyramid(pyramid):
    # Create a new list to store the modified pyramid
    new_pyramid = [row[:] for row in pyramid]

    for i in range(len(pyramid)-2, -1, -1):
        for j in range(i+1):
            new_pyramid[i][j] += max(new_pyramid[i+1][j], new_pyramid[i+1][j+1])
