    num_sum = sum(int(i) for i in num_str)
    return num_sum == num

def narcissistic_nums():
    narcissistic_nums = []
    for num in range(1000, 10000):
        if is_narcissistic(num):
            narcissistic_nums.append(num)
    return narcissistic_nums

