def sum_first_50_primes():
    primes = []
    num = 2
    while len(primes) < 50:
        is_prime = True
        for i in range(2, num):
            if num % i == 0:
                is_prime = False
                break
        if is_prime:
            primes.append(num)
        num += 1
    return sum(primes)
