print_primes(100)

def bubble_sort(arr):
    n = len(arr)
    for i in range(n):
        for j in range(0, n-i-1):
            if arr[j] > arr[j+1]:
                arr[j], arr[j+1] = arr[j+1], arr[j]
    return arr

def find_median(arr):
    sorted_arr = bubble_sort(arr)
    middle_index = len(sorted_arr) // 2
    return sorted_arr[middle_index]

# Example usage:
numbers = [9, 5, 1, 7, 3]
median = find_median(numbers)
print(median)  # Output: 5

