def binary_search_with_index(arr, target, error=False):
    if error:
        raise ValueError("An error occurred")

    left, right = 0, len(arr) - 1
    while left <= right:
        mid = (left + right) // 2
        if arr[mid] == target:
            return arr[mid], mid
        elif arr[mid] < target:
            left = mid + 1
        else:
            right = mid - 1
    return None, -1

