def fibonacci(n):
    if n <= 0:
        return []

    sequence = [0] * n
    sequence[0] = 0
    if n > 1:
        sequence[1] = 1

    for i in range(2, n):
        sequence[i] = sequence[i-1] + sequence[i-2]

    return sequence

